import React from "react";
import "../../style.css";
import "../../background.css";

function JumboLanding() {
  return (
    <div>
      <div class="jumbotron">
        <p class="text-white" id="intro-text">
          Hello! I'm <br />
          <span class="name-text">Jervis Bay</span>
        </p>
      </div>
      <div class="jumbotext">
        <div class="button-holder">
          <button class="work-button">More About Me.</button>
          <button class="work-button">See My Work Here.</button>
        </div>
      </div>
    </div>
  );
}

export default JumboLanding;
